import React from "react";

function Header(){
    return (
        <header>
            <div id="header-content">
                <div id="title-section">
                    <h1 id="website-title">NaoLibre</h1>
                    <img id="website-logo" src="./assets/header_logo.png" alt="NaoLibre logo"/>
                </div>
            </div>
        </header>
    );
}

export default Header;
